import React from "react";

const Main = () => {
  return (
    <div className="row container">
      <div className="col-12 col-sm-12">
          <div className="card">
                <div className="mb-3">
                <label className="form-control" >Comida</label>
                <select className="form-select" >
                    <option selected>Seleccione un plato</option> 
                </select>
                </div>
          </div>
      </div>
    </div>
  );
};

export default Main;
